import Header from './components/header';
import Button from './components/button';
import PlayerPrompt from './components/player_prompt';

const LandingPage = ({nav}) => {
    return(
        <div>
            <Header/>
            <PlayerPrompt />
            <Button text="Play!" onClick={nav}/>
        </div>
    )
}

export default LandingPage;
